import { useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import { v4 as uuidv4 } from "uuid";
import "./App.css";

function Conference() {
    let { id } = useParams()
    let path = `http://localhost:8080?roomId=${id}`
  return (
    <div className="StartConference">
          <h1>{path}</h1>
    </div>
  );
}

export default Conference;
